  ,incomeBeforeTax                   INTEGER  
  ,incomeTaxExpense                  INTEGER  
  ,interestAndDebtExpense            INTEGER  
  ,netIncomeFromContinuingOperations INTEGER  
  ,comprehensiveIncomeNetOfTax       INTEGER  
  ,ebit                              INTEGER  
  ,ebitda                            INTEGER  
  ,netIncome                         INTEGER  
  ,PRIMARY KEY(Symbol,ReportType,fiscalDateEnding)
);
